import React, { useEffect, useState } from 'react';
import axios from 'axios';

function FeedbackDisplay() {
  const [feedbacks, setFeedbacks] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/feedbacks/')
      .then(res => setFeedbacks(res.data))
      .catch(err => console.error("Failed to fetch feedbacks", err));
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Student Feedback‚ù§Ô∏è</h2>

      {feedbacks.length === 0 ? (
        <p style={styles.noFeedback}>No feedback submitted yet.</p>
      ) : (
        <div style={styles.grid}>
          {feedbacks.map((fb, index) => (
            <div key={index} style={styles.card}>
              <h3 style={styles.name}>
                üë§ {fb.name} <span style={styles.id}>({fb.college_id})</span>
              </h3>
              <p style={styles.message}>üìù {fb.message}</p>
              <small style={styles.time}>üïí {new Date(fb.submitted_at).toLocaleString()}</small>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

const styles = {
  container: {
    padding: '2rem',
    background: 'linear-gradient(to right, #e0f7fa, #fce4ec)',
    minHeight: '100vh'
  },
  heading: {
    fontSize: '2.5rem',
    textAlign: 'center',
    marginBottom: '2rem',
    color: '#2c3e50'
  },
  noFeedback: {
    textAlign: 'center',
    fontStyle: 'italic',
    color: '#777'
  },
  grid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
    gap: '1.5rem'
  },
  card: {
    backgroundColor: '#ffffff',
    padding: '1.2rem',
    borderRadius: '12px',
    boxShadow: '0 6px 16px rgba(0,0,0,0.1)',
    transition: 'transform 0.2s ease',
  },
  name: {
    fontSize: '1.1rem',
    color: '#34495e',
    marginBottom: '0.5rem'
  },
  id: {
    fontWeight: 'normal',
    color: '#999',
    fontSize: '0.95rem'
  },
  message: {
    fontSize: '1rem',
    marginBottom: '0.5rem',
    color: '#555'
  },
  time: {
    fontSize: '0.85rem',
    color: '#888'
  }
};

export default FeedbackDisplay;




